import { RadioGroup, RadioButton } from "react-radio-buttons";

function Filter() {
  const position = {
    container: "w-2/5 *:pb-4",
  };
  return (
    <div className={position.container}>
      <Price />
      <Discount />
      <Color />
      <Size />
    </div>
  );
}

export default Filter;

// Sub-components

function Price() {
  const position = {
    inputwrapper: "flex gap-2 items-center",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className="text-lg font-medium">Price</h4>
      {["0-1000", "1000-2000", "2000-3000"].map((item, index) => (
        <label key={item} className={position.inputwrapper}>
          <input
            type="radio"
            name="price"
            className={position.radio}
            value={item}
          />
          <span>{item}</span>
        </label>
      ))}
    </div>
  );
}

function Discount() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Discount</h4>
    </div>
  );
}

function Color() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Color</h4>
    </div>
  );
}

function Size() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Size</h4>
    </div>
  );
}
